function Header(props) {

    const styles = {
        navBar: {
            display: 'flex',
            justifyContent: 'space-between',
            alignItems: 'center'
        },
        links: {
            flexDirection: 'row'
        }
    }

    return (
      <header>
        <nav style={styles.navBar}>
        <ul style>
            <li>
                <a href='#'>My Work</a>
            </li>
            <li>
                <a href='#'>Skills</a>
            </li>
            <li>
                <a href='#'>Contact Me</a>
            </li>
        </ul>
        <a>Tamzin Chikhalia</a>
    </nav>
      </header>
    )
  }

  export default Header;
